import React from 'react';

function Services() {
  return (
    <div>
      <h2 className="text-xl font-bold mb-2">Our Services</h2>
      <ul className="list-disc ml-6">
        <li>X-Ray</li>
        <li>MRI Scan</li>
        <li>CT Scan</li>
        <li>Ultrasound</li>
      </ul>
    </div>
  );
}

export default Services;
